    .main__container {
      padding: 20px 15px;
      background: #28292b;
      margin-bottom: 16px;
      font-size: 25px;
      font-weight: 700;
      color: #fff;
      text-align: center
    }

    .main h1 {
      font-weight: 400;
      margin-bottom: 16px;
      font-size: 36px
    }

    .main__img {
      position: relative;
      display: flex;
      justify-content: center;
      margin-bottom: 25px
    }

    .main__img img {
      width: 100%
    }

    .main__img>.isPlay {
      position: absolute;
      top: 45%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 6em;
      height: 6em;
      opacity: .8
    }

    .video__wControl {
      background-color: rgba(0, 0, 0, .6);
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
      display: flex;
      flex-wrap: nowrap;
      align-items: center
    }

    .video__wControl>svg {
      margin: .1em
    }

    .video__wControl>div {
      margin: 0 .25em
    }

    .video__controlProgress {
      background-color: hsla(0, 0%, 100%, .2);
      height: 6px;
      position: relative;
      flex-grow: 1;
      border-radius: 3px;
      overflow: hidden
    }

    .video__controlProgress:before {
      background-color: #d0021b;
      content: '';
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 20%
    }

    .video__controlInfo {
      float: left;
      font-family: sans-serif;
      font-size: 12px
    }

    .video__controlIc {
      fill: #fff;
      height: 2em;
      width: 2em
    }

    @media screen and (max-width:600px) {
      .main h1 {
        font-size: calc(22px + (36 - 22) * ((100vw - 320px) / (550 - 320)))
      }

      .main__container {
        font-size: calc(16px + (20 - 16) * ((100vw - 320px) / (550 - 320)));
        padding: calc(15px + (20 - 15) * ((100vw - 320px)/ (550 - 320))) 15px
      }

      .header__box {
        height: calc(36px + (45 - 36) * ((100vw - 320px)/ (550 - 320)));
        width: calc(36px + (45 - 36) * ((100vw - 320px)/ (550 - 320)))
      }
    }
